    return(
        <BlogWrap>
            <BlogBackground style={{backgroundImage:`url(${mainBackground})`}}>

            </BlogBackground>
        </BlogWrap>
    );
}

const BlogWrap = styled.div`

`;

const BlogBackground = styled.div`
    height:500px;
`;
export default BlogComponent;
